import {useSelector} from 'react-redux';


function DisplayTask(props)
{
    const listData=useSelector(state=>state.iteam);
    return(<>
        <div>
            <table>
                <th>
                    ID
                </th>
                <th>
                    Task
                </th>
                <th>Action</th>
                    {listData.map((e)=>
                    {
                        return(<tr>
                            <td>{e.id}</td>
                            <td>{e.value}</td>
                            <td><button>Delete</button></td>
                        </tr>)
                    }
                    )}
            </table>
        </div>
    </>)
}
export default DisplayTask;
